import createReducer from '../store/createReducer';

function SET_ACTIVE_DATARUNID(nextState, { datarunID }) {
    nextState.selectedDatarunID = datarunID;
}

export default createReducer({
    dataSetsList: [],
}, {
    SET_ACTIVE_DATARUNID,
});
